  true,\n\t\"url\": null,\n\t\"notes\": \"This memorandum provides information and
  guidance to State agencies and School Food Authorities (SFAs) on the current status
  of the domestic beef market.  Despite an increase in wholesale prices for ground
  beef, the USDA  is continually encouraging schools to purchase and use beef in their
  menus as a good source of lean protein.  The USDA is also offering guidance on ways
  that schools can ensure the resources needed to provide students with healthy, balanced
  meals.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\": [{\n\t\t\"key\":
